(223, 108, 1, NULL, NULL, NULL, '15年老店的「驥園」雞湯，可是許多名人政要的最愛，繁複手續熬煮出的濃香雞湯，一上桌便是香氣滿溢，驥園以新面貌打造出新的「雞窩」，舒適的用餐空間，全新改造中式料理，將傳統風味創意呈現，不變的是驥園正字號的雞湯湯頭，配選其他魚翅等上等食材，提供更健康養生的飲食新觀念。', '2008-12-13 15:36:51'),
