(106, 'Belle Fusion 遊走時尚異國美麗白殿堂 ', '<p><img alt="" width="510" height="320" src="/uploads/Image/bella-fusion.jpg" /><br />\r\n敦化市民路口附近，一棟白色系的建築獨佔了視覺目光，由名模王聖芬與先生Joseph劉表所開的Belle Fusion，將時尚流行與夢想結合，每一層樓都有不同的特色主題，一種融合式的異國風情，美麗的展現在台北街頭。<br />\r\nBelle Fusion的空間設計出自知名設計師耿治國之手，一樓的露天區可以喝咖啡、吃個悠閒早午餐、看街景；二樓的餐廳使用Louis Ghost餐椅，抱抌和天花板的圖騰，是創意設計師邱耀正的作品，入夜後經由特殊照明，白色部份會產生螢光效果，在這裡享受美食還能欣賞落地窗外的樹群和街道，得天獨厚的地段加上別具巧思的設計，Belle Fusion無疑是台北今年最紅的話題餐廳。<br />\r\n<img alt="" width="470" height="330" src="/uploads/Image/474638357_9ecf0c2ef4.jpg" /><br />\r\n總共有五層樓，一、二樓是用餐區，一樓清新的露天舒活吧展現紐約城市風格，除了吸菸區外也有吧檯的座位，二、三樓除了豪華異國料理，也提供英式午茶與別緻的輕食小點，最高樓層則是慵懶靡麗的時尚吧，展現城市享樂的多樣風格。<br />\r\n位於市民大道和敦化南路口，獨棟的白色五層樓建築，透明的玻璃屋頂、清爽高雅的歐式戶外棚架遮陽咖啡座以及入口的低溫玻璃酒櫃，這樣的組合在視覺感上可以說是相當吸引人──這是今年三月甫開張的Belle Fusion。<br />\r\n<img alt="" width="476" height="357" src="/uploads/Image/474624488_e13bfaf187.jpg" /><br />\r\n一樓的開放式座位，白色系的桌椅及頂棚及紗縵，真的很美！<br />\r\n<img alt="" width="357" height="435" src="/uploads/Image/474639169_41b79ace73.jpg" /><br />\r\n二樓餐廳，使用Louis Ghost餐椅，抱抌和天花板的圖騰，是創意設計師邱耀正的作品，入夜後經由特殊照明，白色部份會產生螢光效果。<br />\r\n千島格的桌底上方是玻璃透明的桌面，有沙發也有白色椅子，左邊有很多的弧型構成的可愛燭台，感覺很不錯。<br />\r\n三樓是以黑色歐式華麗打造出的VIP室，隱密空間與外界隔絕，讓私人派對能夠盡情展放，隨著主題喜好創造不一樣的氛圍。<br />\r\n<img alt="" width="358" height="446" src="/uploads/Image/474638821_14365defb9.jpg" /><br />\r\n四樓紅色VIP區，也提供包場，整個地板打紅色的燈光，椅子全都是透明的！<br />\r\n<img alt="" width="359" height="443" src="/uploads/Image/474639053_b1bca1e275.jpg" /><br />\r\n頂樓五樓的Tilatequila是Joseph的最愛殿堂，以透明玻璃屋打造出南美教堂，展現明亮的空間，是享受Tequilas最迷人的私人聚會地點。旁邊有沙發區，再往外是半開放式空間，另外這裡的包場還免費提供Wii！<br />\r\n<strong>推薦餐點：</strong><br />\r\n<img alt="" width="467" height="360" src="/uploads/Image/1184257313.jpg" /><br />\r\n蕃茄寒天酪梨沙拉佐優格醬／220元、泰式香酥酸辣檸檬鰈魚／380元、干藍菜小干貝緹魚義大利麵／380元、西柚汁碳烤鮭魚／450元、墨西哥瑪格麗特蝦盎／200元、蔓越莓冰沙葡萄柚汁／280元、Peach Sangrias／350元<br />\r\n<img alt="" width="470" height="347" src="/uploads/Image/1184257169.jpg" /><br />\r\n脆炸雞翅鑲鵝肝 (260元)，中間的生菜沙拉搭配的莎莎醬，雞翅已經預先去骨裡面包了鵝肝，搭配有黃芥末口味的醬汁。<br />\r\n地址：台北市敦化南路一段149號(敦化南路&amp;市民大道口附近，Haagen Dazs旁)<br />\r\n電話：(02)2777-3322 <br />\r\n營業：一樓及二樓10:00～凌晨00:30 五樓及六樓20:00～凌晨03:00 <br />\r\n座位：200位 <br />\r\n刷卡：可 <br />\r\n訂位：可 <br />\r\n停車：鄰近付費停車場<br />\r\n網址：http://www.belle-fusion.com.tw</p>', 4, '2008-11-29 23:21:00', '2008-12-07 02:04:59', 5, '愉快', 0, 25.0645, 121.737, 1, 1),
(108, '驥園雞窩 中式創意料理 ', '<img alt="" width="469" height="350" src="/uploads/Image/1188470070.jpg" /><br />\r\n15年老店的「驥園」雞湯，可是許多名人政要的最愛，繁複手續熬煮出的濃香雞湯，一上桌便是香氣滿溢，驥園以新面貌打造出新的「雞窩」，舒適的用餐空間，全新改造中式料理，將傳統風味創意呈現，不變的是驥園正字號的雞湯湯頭，配選其他魚翅等上等食材，提供更健康養生的飲食新觀念。<br />\r\n<img alt="" width="497" height="347" src="/uploads/Image/2119060949_b932dc0c16_o.jpg" /><br />\r\n「雞窩」設計時尚的用餐環境，十分迎合附近敦南商圈的都會風格，「雞窩」以雞湯專賣店的型式，提供個人化雞湯套餐的服務，讓人數少又想喝雞湯的顧客也可以喝到自己想喝的雞湯口味。價格從最低500元至最高2000元有五種雞湯可供選擇，套餐內容分別為三樣精緻小菜、二盤百元熱炒與一小鍋雞湯以及最後的甜點飲料的組合，並搭配白飯、麵條或鍋粑三選一。其中雞湯沿用 「驥園」雞湯，可惜其他菜餚卻較沒有特色，但選用的食材都相當不錯，因此整體價格來說不算昂貴。<br />\r\n<img alt="" width="384" height="503" src="/uploads/Image/2091825371_52cff71e9c_o.jpg" /><br />\r\n「驥園」雞湯價格不斐。基本款的沙鍋雞湯即是取用上述的老母雞長時間精燉出來的原味湯頭為湯底，再放入新鮮的土雞肉與火腿干貝後又燉煮數小時，整個過程共需耗費十幾個鐘頭方而完成。另外，還有添加竹笙、魚翅、鮑魚等湯品可選擇，不過相對地價格又會隨之攀升。這樣結合多種食材精華的黃金高湯，不僅蘊含著店家費時費工的心血結晶，也讓人深刻感受到中華飲食文化的美妙風味。<br />\r\n<img alt="" width="519" height="388" src="/uploads/Image/1604247772.jpg" /><br />\r\n店內有砂鍋雞湯、脆筍雞湯、竹笙雞湯和魚翅雞湯等等不同的套餐，價格依序從500、700、1000、1500到2000元不等。每份套餐包括四菜一湯和水果，配菜各有不同，內容每三天一變，考驗廚師設計菜單的功力。這裡的雞湯是由「驥園」本店送過來，用老母雞熬煮12小時，香味四溢，每份套餐還有鍋巴、麵條或飯供客人選擇，另提供水果和花茶。<br />\r\n<img alt="" width="371" height="466" src="/uploads/Image/ap_20071215114947451.jpg" /><br />\r\n地址：台北市敦化南路2段81巷63號(立人國小對面)<br />\r\n電話：(02) 2704-3038<br />\r\n營業：11:30～14:00、17:30～21:30<br />\r\n座位：55位<br />\r\n刷卡：可，加10%服務費<br />\r\n訂位：可<br />\r\n消費：最低500元起<br />\r\n停車：鄰近付費停車場<br />', 3, '2008-11-30 03:11:00', '2008-12-07 02:05:00', 24, '', 0, 25.1204, 121.51, 1, 1),
(109, 'Ruby on rails 開發中常用到的一些方法', '<strong>1.Rails 國際化：globlize 插件：</strong> <br />\r\n&nbsp; http://globalize.rubyforge.org/ <br />\r\n&nbsp; class Product &lt; ActiveRecord::Base <br />\r\n&nbsp;   composed_of :price, :class_name => &quot;Globalize::Currency&quot;, <br />\r\n&nbsp;     :mapping => [ %w(price cents) ] <br />\r\n&nbsp; end <br />\r\n<br />\r\n&nbsp; product.price -> &quot;SFr. 483''232.43&quot; <br />\r\n<br />\r\n<strong>2.auto_discovery_link_tag(type = :rss, url_options = {}, tag_options = {})</strong> <br />\r\nReturns a link tag that browsers and news readers can use to auto-detect an RSS or ATOM feed. The type can either be :rss (default) or :atom. Control the link options in url_for format using the url_options. You can modify the LINK tag itself in tag_options. <br />\r\n<br />\r\nTag Options: <br />\r\n:rel - Specify the relation of this link, defaults to &quot;alternate&quot; <br />\r\n:type - Override the auto-generated mime type <br />\r\n:title - Specify the title of the link, defaults to the type <br />\r\n<br />\r\nauto_discovery_link_tag(:rss, {:action => &quot;feed&quot;}, {:title => &quot;My RSS&quot;}) # => <br />\r\n&nbsp;\r\n<link rel="alternate" type="application/rss+xml" title="My RSS" href="http://www.curenthost.com/controller/feed" /><br />\r\n<br />\r\n<strong>3.textilize(text)</strong> <br />\r\nReturns the text with all the Textile codes turned into HTML tags. This method is only available if RedCloth is available. <br />\r\n9.sanitize(html) <br />\r\nSanitizes the html by converting\r\n<form>\r\n    and <script> tags into regular text, and removing all "onxxx" attributes (so that arbitrary Javascript cannot be executed). It also removes href= and src= attributes that start with "javascript:". You can modify what gets sanitized by defining VERBOTEN_TAGS and VERBOTEN_ATTRS before this Module is loaded. <br />\r\n<br />\r\nsanitize(''<script> do_nasty_stuff() </script>'') <br />\r\n    => &lt;script> do_nasty_stuff() &lt;/script> <br />\r\n    sanitize(''<a href="javascript: sucker();">Click here for $100</a>'') <br />\r\n    => <a>Click here for $100</a><br />\r\n    &nbsp;\r\n</form>', 3, '2008-11-30 17:36:00', '2008-12-07 02:05:01', 24, '', 0, 22.6292, 114.134, 1, 1);
