INSERT INTO `groups` (`id`, `name`, `description`, `news`, `office`, `email`, `address`, `city`, `website`, `mode`, `user_id`, `avatar_id`, `created_at`, `updated_at`) VALUES
(1, 'Taiwan! Where''s the music at?', 'This group is for music geeks of all sorts living in Taiwan to share music related info about the Taiwan scene. Indie, Experimental, Left-field pop as well as any other original music is welcome to be discussed in this group. It is a place for musicians and music lovers to exchange information on venues, shops and events that are music-geek friendly and to foster stronger bonds in the Taiwan music community.', 'This group is open to anyone musically inclined or concerned to share info about the Taiwan music scene. Particularly, it is open to artists and musicians to share info/ideas or promote their music/upcoming shows. It is open to music lovers representing any/all genres so long as the music being discussed/promoted is original music.', 'Taipei, Taiwan', 'mitnik@live.com', '台北市內湖區中正路123號12樓', '台北市', NULL, 2, 3, NULL, '2008-12-10 04:52:13', '2008-12-11 18:38:21'),
(2, '測試群組', '開放群組測試', '群組功能測試!!', '台北市', 'mitnik@live.com', '台北市內湖區中正路121號', '台北', NULL, 0, 3, NULL, '2008-12-10 05:34:00', '2008-12-10 05:34:00'),
(3, '台北 (Taipei City)', '<p>這裡是台北市公所. 此市公所是專門服務所有大台北地區市民以及對台北抱持好感的民眾.請各位鄉親父老盡快登記姓名以取得居留權.</p>\r\n\r\n<p>This site is for the entire Taipei residents and people who are interested at Taipei City.</p>\r\n\r\n<p>歡迎來到台北城!<br>\r\nWelcome to Taipei City!</p>', '', '', '', '', 'Taipei, Taiwan', NULL, 1, 2, NULL, '2008-12-11 19:00:51', '2008-12-11 19:00:51'),
(4, '測試私密群組', '測試用的私密群組,加入群組需要經過群組管理員的審核', '123456789', '', '', '', '', NULL, 1, 3, NULL, '2008-12-12 10:41:25', '2008-12-12 10:41:25'),
(5, '測試隱藏群組', '測試隱藏群組', 'wetwetaerhyeryhrt', '', '', '', 'Tainan', NULL, 2, 3, NULL, '2008-12-12 11:32:35', '2008-12-12 11:32:35'),
(6, 'Hiden Group', 'rahtjhtjtjtfjfgsjrtdj', 'ghsethsbhrth', '', '', '', '', NULL, 2, 1, NULL, '2008-12-12 11:34:08', '2008-12-12 11:34:08'),
(7, 'University of Dallas Alumni Association', '<p>Official Facebook Group of the UD Alumni Association</p>\r\n<p>Go Crusaders! And Groundhogs - just so we don''t leave out the rugby players and those who love them.</p>', 'Attention DFW alumni!! This month we''d love to get a group together for the Greek Festival of Dallas!!', '', '', '', 'United State', NULL, 2, 1, NULL, '2008-12-12 18:31:45', '2008-12-12 18:31:45'),
(8, 'Who do you GoodSearch for?', '<p>** If the 70 MILLION Active Facebook users used GoodSearch just once a day we could TOGETHER raise over 250 million dollars a year for charitable causes. **</p>\r\n\r\n<p>As the economy slows and donations are down, nonprofits are desperate for your help! Here is a FREE, EASY way to help get money for cancer research, saving the environment, homeless pets and every other cause.</p>\r\n\r\n<p>Simply use GoodSearch as your search engine and every time you search, it will make a donation to your favorite cause.<br>\r\nAnd, when you shop online, do so through the GoodShop shopping mall (featuring hundreds of stores including Amazon and Best Buy) which donates a percentage of each purchase to your favorite cause.<p>', '<p>WHY SHOULD I USE GOODSEARCH?<br>\r\nOur goal is to help as many nonprofits and schools as possible. We want to help fund the great works they are doing. And, as important as the money, GoodSearch allows people to feel connected to organizations helping to make the world a better place and support them every single day. We believe that "doing good" should be a part of people''s everyday lives.<p>\r\n\r\n<p>IS THIS LEGITIMATE?<br>\r\nAbsolutely! We have partnered with Yahoo! in an effort to provide users with competitive search results, we have created an advisory council that includes the CFO of the Walt Disney Company among others, and we have been featured in publications across the country including The New York Times, Oprah Magazine and The Wall Street Journal.<p>\r\n\r\n<p>WHAT CHARITY CAN I SUPPORT?<br>\r\nWe currently have over 60,00 non-profits and schools listed on the GoodSearch site with more adding every day! You can search on behalf of your school or a local or national charity that you want to support. Check out the images below for example non-profits that are listed on GoodSearch.</p>\r\n\r\n<p>HOW DO I LET OTHERS KNOW ABOUT GOODSEARCH?<br>\r\nFind a list of suggestions here!<br>\r\nhttp://www.goodsearch.com/GetInvolved.aspx</p>\r\n\r\n\r\n<p>Learn more about GoodSearch here..<br>\r\nhttp://www.goodsearch.com/About.aspx</p>\r\n\r\n<p>PLEASE CLICK ON THE IMAGES BELOW FOR EXAMPLES OF CHARITIES YOU CAN SUPPORT THROUGH GOODSEARCH!</p>', '', 'information@goodsearchc.om', '', 'United State', 'http://www.GoodSearch.com', 0, 1, NULL, '2008-12-13 12:58:26', '2008-12-13 13:16:57'),
(9, 'Liquid Lifestyle Promotions', '<p>Liquid Lifestyle Promotions是個卓越、新潮的活動規劃宣傳團體，將把你餘暇的時間充實、帶領到另一個領域。我們專將二十、三十歲左右有魅力、有氣質、惹眼的時尚 男女聚在一起盡享同樂。我們的音樂領域、我們的風格、和相似的生活態度，不管走到那兒都能帶動一股潮流。</p>\r\n<p>我們在氣氛姿態不同的時尚空間帶給台北革新、獨特的派對活動。Liquid Lifestyle的構成是為了要符合我們不時異變、不時流動的生活姿態。我們不斷的舉辦活動讓好朋友們一起共同分享我們嗜好的音樂和理念。就是這樣貼心的構想態度讓Liquid Lifestyle Promotions成為活動規劃宣傳團體中的傑出者。</p>\r\n<p>Liquid Lifestyle Promotions專門做全方位的活動規劃: 從企劃到宣傳, 從執行到主導。 我們合作過的客戶: Hewlett Packard, Heineken啤酒, Carolina Herrera香水, 212 Sexy香水, Patron龍舌蘭, Jack Daniel''s, Nokia, Skyy伏特加, Remix服飾, O’Neill服飾等。</p>\r\n', 'Join us. Immerse your mind, body, and soul.', '', '', '', '', 'http://www.liquid-lifestyle.com', 0, 3, NULL, '2008-12-14 17:18:56', '2008-12-14 17:18:56'),
(10, 'Japan Traveler', 'The Traveler of Japan, just talk something!!', '', '', '', '', 'Taipai', 'http://www.googe.com', 2, 16, NULL, '2008-12-15 18:23:44', '2008-12-15 22:40:56'),
(11, 'Mika''s Hidden Group', 'This Is Hidden Group Test', 'No Entry.', '', '', '', '台南縣', '', 2, 16, NULL, '2008-12-15 22:44:37', '2008-12-15 22:44:37'),
(12, 'The Happy Christmas Holiday', '.•*´¨`*•.CREATOR DESERTED A SINKING SHIP.•*´¨`*•.<br>\r\nWish Everybody Has a happy Christmas Day.', 'WELL.. The blackout occurred.. and nothing happened!!', 'worldwide', 'santa@happychristmasday.org', '', 'North Pole', 'http://www.google.com/', 0, 3, NULL, '2008-12-17 17:23:13', '2008-12-18 01:27:41'),
(13, '宅男俱樂部', '阿宅俱樂部~歡迎所有宅男宅女加入XD', '', '', '', '', '台灣', '', 0, 2, NULL, '2008-12-25 00:44:18', '2008-12-25 00:44:18');
