(81, '瑞典冰旅館', '在瑞典北部基律納一個名叫朱卡恩佳維的小村裡，有一座冰旅館。每年冬天，都有很多年輕人在這裡的冰教堂舉行婚禮。牧師在冰雕講壇上主持婚禮，新人在冰雕十字架下交換婚戒，然後坐上狗拉雪橇，去往冰旅館的“新婚套房”。', '2008-08-18 14:41:53', 'image/jpeg', '458_2.jpg', NULL, NULL, NULL, 55919, 640, 480, 67.8497, 20.5956, 1, NULL, 9, 7, '2008-12-03 21:52:17', NULL, 3, 'User'),
