(84, '東京鐵塔', '東京鐵塔由建築師內藤多仲與「日建設計株式會社」共同設計。高332.6米，於12月23日開始正式營業。燈光照明由世界著名照明設計師，石井乾子設計主持，照明時間為日落到午夜0點之間。燈光顏色隨季節變化，夏季為白色，春，秋，冬季為橙色。塔在150米處設有大瞭望台，249.9米處設有特別瞭望台，可一覽東京都內景色，晴朗之日可遠眺富士山。', '2008-08-18 15:56:37', 'image/jpeg', 'tokyo_tower.jpg', NULL, NULL, NULL, 28105, 640, 480, 35.6587, 139.745, 1, NULL, 9, 6, '2008-12-03 21:52:18', NULL, 3, 'User'),
