(87, '水立方', '晶瑩剔透的中國國家游泳中心"水立方"是北京目前所有在建的奧運體育場館中較為漂亮的一個，夢幻般的方形"水泡"效果圖給人們留下了深刻的印象。但是如何清潔、如何節能等問題在人們心中一直盤桓不去。如今，它正式取下面紗完整地走入人們視線，於是早已深藏人們心中的一些疑問紛紛擺上臺面。', '2008-08-18 18:04:33', 'image/jpeg', 'water-cube.jpg', NULL, NULL, NULL, 302316, 640, 435, 39.9914, 116.384, 1, NULL, 9, 5, '2008-12-03 21:52:19', 1, 3, 'User'),
