(41, 20, 1, '閒閒沒事來砍人!!', '2008-12-06 20:36:09', '2008-12-07 02:14:17', NULL, NULL, 'ForumPost'),
(44, NULL, NULL, '<p>在時間的流逝過程中，原子純粹偶然地連結成各種的結合體，其中也包括生命的存在，快樂和痛苦就在它們中作為運動的特殊的變更過程而產生，事物相應地被區分為快意的和不快意的、善的和惡的。就像所有的原子結合體一樣，這些事物也要再一次被偶然地分解，個體不斷地滅亡，最後是種的滅亡，形成生命的條件也將不再存在，這樣快樂和痛苦、善和惡也要一起消失，只在身後留下無感覺的原子和無理性的法則。</p>\r\n<p align="right">[德] 弗里德里希 包爾生</p>', '2008-12-08 04:37:28', '2008-12-08 04:37:28', 1, '生命&哲學', 'BlogPost'),
(45, NULL, NULL, '我的價值體現在哪裡？這個問題只有我自己最清楚！眾人都是愚昧的，他們不了解我是大海，我是凌駕並超越他們的。尼采說過：“人是一條污河。你必須是大 海，才能接受一條污河而不致自污。”而我認為，只有站在超人之上，才能回答出：我的海洋是骯髒和污穢的，所以我更了解清澈和純潔的美好。是的，愚昧的人會以偽善者和假道學來攻擊和質疑我。從未體驗過病痛的人會了解健康的喜悅嗎？同樣，只有身處在最黑暗、最陰沉的深淵中的痛苦，才是對光明和幸福最恰當的讚美者。我的價值體現在我即將說的那些話語中。愚昧的人視其為糞土，我的同伴將視其為圭臬。', '2008-12-08 04:47:59', '2008-12-08 21:47:26', 1, '一篇新福音的開始..', 'BlogPost'),
(46, 22, 3, '<p>Configure & index Model use Ultrasphins：</p>\r\n\r\nrake ultrasphinx:configure<br>\r\nrake ultrasphinx:index<br>\r\nrake ultrasphinx:daemon:start<br>', '2008-12-09 00:41:00', '2008-12-09 00:49:13', NULL, NULL, 'ForumPost'),
(47, 22, 3, 'Now, in your models, use the <tt>is_indexed</tt> method to configure a model as searchable. For example:<br><br>\r\n  \r\n<blockquote>\r\nclass Post<br>\r\n  is_indexed :fields => [''created_at'', ''title'', ''body'']<br>\r\nend</blockquote>\r\n<br>\r\n  \r\nFor more index options, see ActiveRecord::Base .is_indexed.', '2008-12-09 00:58:45', '2008-12-09 00:58:45', NULL, NULL, 'ForumPost'),
(48, 22, 3, '<p>== Installation</p>\r\n  \r\n<p>First, install Sphinx itself. Get the {0.9.8 snapshot}[http://www.sphinxsearch.com/downloads.html], then run <tt>./configure</tt>, <tt>make</tt>, and <tt>sudo make install</tt>. Make sure to set your <tt>./configure</tt> flags: <tt>----prefix</tt> if necessary, and also <tt>----with-pgsql</tt> if you need Postgres support.</p>\r\n\r\n<p>You also need the <tt>chronic</tt> gem:<br>\r\n<blockquote>sudo gem install chronic</blockquote></p>', '2008-12-09 01:18:43', '2008-12-09 01:18:43', NULL, NULL, 'ForumPost'),
