(59, NULL, NULL, '<p>How many cooks does it take to produce the perfect recipe? I’d say one, a really good one. Barnaby Dorfman thinks that 1,000 cooks can come up with a better recipe than any single chef, and earlier today he launched Foodista around that premise. It is a Wikipedia for food. Each recipe can be collaboratively edited and improved. Scrumptious photos for each dish are pulled in from Flickr, and descriptions are pulled in from Wikipedia itself. You can add or remove ingredients, see the edit history, or add a comment to each page.</p>\r\n<p>http://www.foodista.com/</p>', '2008-12-18 20:26:30', '2008-12-18 20:26:30', 3, 'Foodista Tries To Prove That More Cooks In the Kitchen Will Produ', 'BlogPost'),
(60, NULL, NULL, 'There are way too many comment login systems out there. Each blogging platform (Wordpress, Typepad, Blogger) has its own login system, then there are the cross-platform commenting systems like Disqus and JS-KIT. But many of these will soon give way to Facebook Connect and Google’s Friend Connect.', '2008-12-18 20:33:14', '2008-12-18 20:33:14', 3, 'Soon, All Your Blog Comments Will Belong To Facebook', 'BlogPost'),
