(65, NULL, NULL, '<p>The guest post below is written by Ryan Hupfer at HubPages. A couple of weeks ago HubPages ads were blocked from MySpace’s new self serve ad platform, MyAds, as being competitive to MySpace. That problem was fixed, but we asked Ryan, who advertises on both MySpace and Facebook, to write a guest post comparing the two platforms.</p>\r\n\r\n<p>His results are below. In a nutshell, he finds Facebook a much better experience. When it comes to the results, though, things are mixed. Ryan’s test showed a lower cost per click on MySpace than Facebook ($.27 v. $.44). But the Facebook clicks were more productive: a new user cost just $5.11 on Facebook, v. $8.03 on MySpace.</p>\r\n\r\n<p>The results, though, can’t be taken too seriously, for a number of reasons. First, Ryan spent $3,119 on Facebook ads and only $225 on MySpace (he says MySpace ads are much harder to administer, so he spent less). But that difference alone makes the results unreliable. Second, Facebook has text ads, MySpace has display ads, so the results are not apples-to-apples.</p>', '2008-12-23 00:00:43', '2008-12-23 00:00:43', 31, 'MySpace v. Facebook Advertising Showdown. Which Platform Is Bette', 'BlogPost'),
