(1, 'Admin', 'mitnik@y7mail.com', '240be518fabd2724ddb6f04eeb1da5967448d7e831c08c8fa822809f74c720a9', 1, '我是帥哥帆!!! 我他媽的超級帥～幹\r\n\r\n<p>沒有風險就不是人生<br>\r\n有人說你很想要一樣東西<br>\r\n就放他走<br>\r\n如果他回來找你<br>\r\n那麼他永遠就是你的<br>\r\n但是他不回來<br>\r\n那麼他根本就不是屬於你的</p>', '2008-07-18 13:30:02', '2008-12-25 00:36:49', '2008-12-24 17:44:50', 9, 22, 'Mitnik的美食日記', 1, 30, '在 Kevin Mitnik 的留言板新增留言', '2008-12-25 00:36:48', 'mitnik', '21866297@N06', 'Kevin', 'D', 'Mitnik', 'Kevin Mitnik', NULL, NULL, NULL, '', NULL, NULL, '2008-07-18 13:33:02', '你第一隻寵物的名字是什麼？', '吉利', NULL, NULL, NULL, 1, 1, 1, 1, 1, 1, 'blogmitnik', 6, 1, 1, 0, 1),
(2, 'Mitnik', 'mitnik@live.com', '8d969eef6ecad3c29a3a629280e686cf0c3f5d5a86aff3ca12020c923adc6c92', 1, 'Hi~I am jason ^_^', '2008-07-18 13:38:11', '2008-12-25 02:52:56', '2008-12-25 02:52:56', 4, 5, 'Mitnik''s Blog', 1, 6, '張貼了一篇討論文章', '2008-12-25 02:52:51', 'aphroditee1', '15541099@N07', 'Jason', '', 'Chang', '', NULL, NULL, NULL, NULL, NULL, NULL, '2008-07-18 13:39:11', NULL, NULL, NULL, NULL, NULL, 1, 1, 1, 1, 1, 1, 'jackliu', 1, 1, 1, 0, 0),
(3, 'jeff1123', 'blog.mitnik@gmail.com', 'a8abb82702d5702a7fb62220d25531ea71cf7a98a3534419a930027e3b38cc87', 1, '<p>Yo~man, 我是帥哥帆~我非常帥</p>\r\n<p>I would like to take the time and thank everyone who has ever supported me in my envdevors</p>\r\n<p>自我介绍：我喜歡幹架 扁人是我的專長 思考人生是我的興趣 最難的對我來說是最簡單的 最簡單的對我來說卻是最難的</p>\r\n<p>近期心願：領悟出人生中的最高精神意義和最終道德原則 並以此建立拯救人類的最新宗教,尤其是對宅男群體的存在價值做出新的貢獻！</p>', '2008-07-18 17:32:28', '2008-12-25 02:13:35', '2008-12-24 00:34:11', 13, 30, '帥哥帆的日誌', 1, 16, '在 David Wang 建立的活動新增留言', '2008-12-25 02:13:34', 'mitnik', '21866297@N06', 'David', '', 'Wang', 'David Wang', NULL, NULL, NULL, NULL, NULL, NULL, '2008-07-18 17:33:18', NULL, NULL, NULL, NULL, NULL, 1, 1, 1, 1, 1, 1, 'CWTV', 3, 1, 1, 0, 0),
(4, 'guest', 'abc123@gmail.com', '8d969eef6ecad3c29a3a629280e686cf0c3f5d5a86aff3ca12020c923adc6c92', 1, '這是Guest來賓帳號^^b', '2008-07-21 12:58:23', '2008-12-20 19:05:14', '2008-12-20 19:05:14', 2, 2, '來賓帳號日誌', 1, 9, '和 Mika Nakashima 成為了朋友', '2008-12-20 18:13:56', '', '21866297@N06', 'Guest', '', 'People', 'Guest Man', NULL, NULL, NULL, NULL, NULL, NULL, '2008-07-21 12:59:43', NULL, NULL, NULL, '2008-10-17 02:21:50', NULL, 1, 1, 1, 1, 1, 1, NULL, 2, 1, 1, 0, 0),
